            'If you\'re trying to cut back on empty <a href="https://spoonacular.com/academy/carbohydrates">carbs</a>, try replacing croutons with something healthier, like a soup topper of nuts and seeds. If croutons are a necessity, look for a whole wheat variety or make your own.',
            'If you\'re trying to cut back on empty <a href="https://spoonacular.com/academy/carbohydrates">carbs</a>, try replacing croutons with something healthier that still gives you that satisfying crunch, like nuts and seeds. ',
