        summary:
          'Smoky Chipotle Sweet Potato Salad requires approximately <b>45 minutes</b> from start to finish. This side dish has <b>217 calories</b>, <b>3g of protein</b>, and <b>9g of fat</b> per serving. This recipe serves 10. For <b>78 cents per serving</b>, this recipe <b>covers 11%</b> of your daily requirements of vitamins and minerals. This recipe from Foodista requires sweet potatoes, salt and pepper, other optional mix-ins: cilantro, and balsamic vinegar. <b>The Fourth Of July</b> will be even more special with this recipe. It is a good option if you\'re following a <b>gluten free, dairy free, paleolithic, and lacto ovo vegetarian</b> diet. 1 person found this recipe to be delicious and satisfying. All things considered, we decided this recipe <b>deserves a spoonacular score of 77%</b>. This score is solid. <a href="https://spoonacular.com/recipes/beef-potato-salad-with-smoky-chipotle-696163">Beef & Potato Salad with Smoky Chipotle</a>, <a href="https://spoonacular.com/recipes/smoky-grilled-sweet-potato-salad-546070">Smoky Grilled Sweet Potato Salad</a>, and <a href="https://spoonacular.com/recipes/smoky-sweet-potato-bean-cakes-with-citrus-salad-504012">Smoky sweet potato & bean cakes with citrus salad</a> are very similar to this recipe.',
