        instructions:
          '<p><strong>1</strong> Toss shrimp with chipotle chile powder and salt and put in the refrigerator to marinate while you make the pasta and the rest of the salad.</p><p><strong>2</strong> Put a large pot of salted water on to a boil (2 quarts of water, 1 Tbsp salt).</p><p><strong>3</strong> While the water is heating, cook the bacon. Put the bacon in a small saucepan on medium heat. Cook until most of the fat has rendered out and the bacon pieces are lightly browned. Remove bacon to a paper towel lined plate. Discard or save for future use all but one tablespoon of the rendered bacon fat (do not pour bacon fat down the drain or you will be calling your plumber).</p><p><img src="http://www.simplyrecipes.com/wp-content/uploads/2015/06/shrimp-bacon-avocado-pasta-method-600-1.jpg" alt="shrimp-bacon-avocado-pasta-method-600-1"> <img src="http://www.simplyrecipes.com/wp-content/uploads/2015/06/shrimp-bacon-avocado-pasta-method-600-3.jpg" alt="shrimp-bacon-avocado-pasta-method-600-3"></p><p><strong>4</strong> Increase the heat to high and add the shrimp. Sauté until done, a few minutes.</p><p><strong>5</strong> When the pasta water comes to a boil, add the pasta and cook until al dente, cooked through but still a little firm to the bite (usually 1 or 2 minutes less than what the package calls for).</p><p><strong>6</strong> Put all of the dressing ingredients into a jar, cover and shake until well blended.</p><p><strong>7</strong> When the pasta is ready, strain it and rinse with cold water. Place in a large bowl. Add the vinaigrette and toss with the shrimp, bacon, bell peppers, and onions. Add the cilantro and avocado just before serving.</p>',
