        summary:
          'The recipe Chicken Medallions And Fruit Salad can be made <b>in around 45 minutes</b>. This recipe serves 12 and costs 64 cents per serving. Watching your figure? This gluten free, dairy free, paleolithic, and primal recipe has <b>91 calories</b>, <b>4g of protein</b>, and <b>3g of fat</b> per serving. Not a lot of people made this recipe, and 1 would say it hit the spot. It is brought to you by Foodista. It works well as a hor d\'oeuvre. If you have chicken breast, iceberg lettuce, strawberries, and a few other ingredients on hand, you can make it. Taking all factors into account, this recipe <b>earns a spoonacular score of 32%</b>, which is not so awesome. Similar recipes are <a href="https://spoonacular.com/recipes/grilled-pork-medallions-with-spicy-potato-salad-707879">Grilled Pork Medallions with Spicy Potato Salad</a>, <a href="https://spoonacular.com/recipes/balsamic-pork-medallions-with-grilled-peaches-wild-rice-salad-1400071">Balsamic Pork Medallions with Grilled Peaches & Wild Rice Salad</a>, and <a href="https://spoonacular.com/recipes/balsamic-pork-medallions-with-grilled-peaches-wild-rice-salad-583936">Balsamic Pork Medallions with Grilled Peaches & Wild Rice Salad</a>.',
