        summary:
          'Forget going out to eat or ordering takeout every time you crave Mexican food. Try making Shrimp Tacos with Avocado, Grapefruit, and Creamy Cilantro Sauce at home. For <b>$1.6 per serving</b>, this recipe <b>covers 12%</b> of your daily requirements of vitamins and minerals. This recipe serves 6. Watching your figure? This gluten free and pescatarian recipe has <b>207 calories</b>, <b>9g of protein</b>, and <b>11g of fat</b> per serving. If you have salt & pepper, lime juice, tomato, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes approximately <b>30 minutes</b>. It is brought to you by spoonacular user <a href="/profile/maplewoodroad">maplewoodroad</a>. It works well as a rather inexpensive hor d\'oeuvre. Similar recipes include <a href="https://spoonacular.com/recipes/chicken-and-avocado-tacos-with-creamy-cilantro-sauce-999823">Chicken and Avocado Tacos with Creamy Cilantro Sauce</a>, <a href="https://spoonacular.com/recipes/spicy-shrimp-tacos-with-avocado-salsa-sour-cream-cilantro-sauce-1300327">Spicy Shrimp Tacos with Avocado Salsa & Sour Cream Cilantro Sauce</a>, and <a href="https://spoonacular.com/recipes/spicy-shrimp-tacos-with-avocado-salsa-sour-cream-cilantro-sauce-721265">Spicy Shrimp Tacos with Avocado Salsa & Sour Cream Cilantro Sauce</a>.',
