        summary:
          'Summer Pesto Noodle Salad requires approximately <b>45 minutes</b> from start to finish. This recipe makes 3 servings with <b>232 calories</b>, <b>8g of protein</b>, and <b>16g of fat</b> each. For <b>$2.41 per serving</b>, this recipe <b>covers 17%</b> of your daily requirements of vitamins and minerals. It works well as a budget friendly hor d\'oeuvre. Head to the store and pick up basil, garlic, peach, and a few other things to make it today. 1 person found this recipe to be flavorful and satisfying. It is brought to you by Foodista. It is perfect for <b>The Fourth Of July</b>. It is a good option if you\'re following a <b>gluten free, dairy free, lacto ovo vegetarian, and vegan</b> diet. With a spoonacular <b>score of 70%</b>, this dish is solid. Similar recipes are <a href="https://spoonacular.com/recipes/almost-summer-rice-noodle-salad-17774">Almost-summer Rice Noodle Salad</a>, <a href="https://spoonacular.com/recipes/cold-summer-zucchini-noodle-pasta-salad-1005941">Cold Summer Zucchini Noodle Pasta Salad</a>, and <a href="https://spoonacular.com/recipes/pesto-tabbouleh-summer-salad-891501">Pesto Tabbouleh Summer Salad</a>.',
