        summary:
          'You can never have too many Mediterranean recipes, so give summer vegetable pizzan a try. One portion of this dish contains roughly <b>27g of protein</b>, <b>20g of fat</b>, and a total of <b>614 calories</b>. This recipe serves 4 and costs $4.01 per serving. This recipe is liked by 2 foodies and cooks. This recipe from Foodista requires pepper, onion, thyme, and eggplant. It works best as a main course, and is done in roughly <b>45 minutes</b>. <b>The Fourth Of July</b> will be even more special with this recipe. Overall, this recipe earns a <b>good spoonacular score of 69%</b>. Try <a href="https://spoonacular.com/recipes/summer-grilled-vegetable-pizza-241631">Summer Grilled Vegetable Pizza</a>, <a href="https://spoonacular.com/recipes/summer-vegetable-pizza-with-a-cauliflower-crust-604011">Summer Vegetable Pizza with a Cauliflower Crust</a>, and <a href="https://spoonacular.com/recipes/summer-time-vegetable-pizza-pie-511390">Summer Time Vegetable Pizza Pie</a> for similar recipes.',
