        summary:
          'Need a <b>dairy free, lacto ovo vegetarian, and vegan main course</b>? Summer Garlic Mushrooms and Mostaccioli could be an awesome recipe to try. This recipe makes 4 servings with <b>472 calories</b>, <b>15g of protein</b>, and <b>15g of fat</b> each. For <b>$2.89 per serving</b>, this recipe <b>covers 25%</b> of your daily requirements of vitamins and minerals. Only a few people made this recipe, and 1 would say it hit the spot. If you have basil, olive oil, lemon zest, and a few other ingredients on hand, you can make it. It is perfect for <b>The Fourth Of July</b>. It is brought to you by Foodista. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 83%</b>. This score is super. If you like this recipe, take a look at these similar recipes: <a href="https://spoonacular.com/recipes/creamy-mostaccioli-with-bacon-and-mushrooms-139408">Creamy Mostaccioli With Bacon and Mushrooms</a>, <a href="https://spoonacular.com/recipes/roasted-garlic-and-tomato-mostaccioli-164288">Roasted Garlic and Tomato Mostaccioli</a>, and <a href="https://spoonacular.com/recipes/mostaccioli-with-roasted-tomato-and-garlic-cooking-for-2-172323">Mostaccioli with Roasted Tomato and Garlic (Cooking for 2)</a>.',
