        summary:
          'Summertime Seafood Pie requires roughly <b>45 minutes</b> from start to finish. This recipe serves 4. One portion of this dish contains roughly <b>69g of protein</b>, <b>18g of fat</b>, and a total of <b>572 calories</b>. For <b>$21.01 per serving</b>, this recipe <b>covers 42%</b> of your daily requirements of vitamins and minerals. This recipe is liked by 1 foodies and cooks. It is a good option if you\'re following a <b>pescatarian</b> diet. This recipe from Foodista requires kosher salt, eachs sea scallops, flat leaf parsley, and several pepper. Overall, this recipe earns a <b>solid spoonacular score of 50%</b>. Users who liked this recipe also liked <a href="https://spoonacular.com/recipes/summertime-seafood-nachos-with-grilled-corn-avocado-cream-524639">Summertime Seafood Nachos with Grilled Corn + Avocado Cream</a>, <a href="https://spoonacular.com/recipes/summertime-key-lime-pie-1100366">Summertime Key Lime Pie</a>, and <a href="https://spoonacular.com/recipes/provencal-seafood-pie-84970">Provencal Seafood Pie</a>.',
